import { useState, useEffect } from "react";
import { Button } from "react-bootstrap";
import "./Home.css";
import SignUp from "./SignUp";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const Home = () => {
  const [placeholder, setPlaceholder] = useState("Hi");

  useEffect(() => {
    fetch("/hello")
      .then((res) => res.json())
      .then((data) => {
        console.log("data", data);
        setPlaceholder(data);
        // setPlaceholder(data.result);
      });
  }, []);

  const handleClicked = () => {
    <Switch>
      <Route exact path="/sign-up" component={SignUp} />;
    </Switch>;
  };

  return (
    <div>
      <h3 className="content center">
        Find new and
        <br />
        meaningful
        <br />
        connections
        <br />
        easily
      </h3>
      <p className="content-paragraph center">
        Create new friendships and meet
        <br />
        new people around you based on
        <br />
        your mutual interests and hobbies
      </p>
      <Button href="#" variant="primary" onClick={() => handleClicked()}>
        Flask says: {placeholder}
      </Button>
      {/* <p className="i-want-button">Flask says {placeholder}</p> */}
    </div>
  );
};

export default Home;
